import React from 'react';
import defaultImg from '../Utility/defaultImg.jpg';
const PokemonThumb = ({ pokemon }) => {
    const Pokemon = {
        name: pokemon.name,
        id: pokemon.id,
        height: pokemon.height,
        weight: pokemon.weight,
        front_img: pokemon.sprites.front_default,
        back_img: pokemon.sprites.back_default,
        types: pokemon.types.map(ele => (ele.name))
    }

    return (
        <div>
            <img src={pokemon.sprites.front_default} alt={defaultImg} id={pokemon.order} className='rounded' />
            {/* {
                types.map(element => (
                    <span>
                        {element.name}
                    </span>
                ))
            } */}
        </div>
    )
}

export default PokemonThumb;
